@santiagobasulto I should do a thread on this. (Students from my Functions class from @OReillyMedia should know this 😉).

/ means all preceding args are positional only (ie you can't do calc(x=5, y=6) )

* means all subsequent args are keyword only (ie you can't do calc(5,6,'add'))

@santiagobasulto @OReillyMedia To answer the why:

/ - 99% of devs don't need this unless you work on cPython
* - This makes calls more readable. Magic numbers now have context. (I really like this feature).

@tonycapp @santiagobasulto @OReillyMedia Adding the variable name prevents calls like:

